import React from "react";

const Card = ({ pg, onClick }) => (
  <div className="card" onClick={onClick}>
    <img src={pg.image} alt={pg.name} />
    <h3>{pg.name}</h3>
    <p className="location">Location: {pg.location}</p>
    <p>{pg.description}</p>
    <button>View Details</button>
  </div>
);

export default Card;
